import React, { useMemo, useState } from "react";
import "../styles/MobileHome.css";

/**
 * MobileHome - mobile-specific homepage (cards list + hero + filters)
 * Props:
 *   - cars: array of { id, title, subtitle, price, image, km, fuel, transmission, hub, emi }
 */
export default function MobileHome({ cars = [] }) {
  const [query, setQuery] = useState("");
  const [view, setView] = useState("list"); // list | grid

  const filtered = useMemo(() => {
    const q = query.trim().toLowerCase();
    if (!q) return cars;
    return cars.filter((c) => (c.title || "").toLowerCase().includes(q));
  }, [cars, query]);

  return (
    <div className="mh-root">
      {/* hero */}
      <section className="mh-hero">
        <img className="mh-hero-img" src={process.env.PUBLIC_URL + "/hero-mobile.jpg"} alt="hero" />
        <div className="mh-hero-overlay">
          <h2 className="mh-hero-title">god promise</h2>
          <p className="mh-hero-sub">3-year warranty on Assured+ cars</p>
        </div>
      </section>

      {/* controls */}
      <div className="mh-controls">
        <button className="mh-filter" aria-label="filters">ðŸ”§ Filter</button>
        <div className="mh-search-wrap">
          <input value={query} onChange={(e) => setQuery(e.target.value)} className="mh-search" placeholder="Search model (Tiago)" />
        </div>
        <button className="mh-toggle-view" onClick={() => setView(view === "list" ? "grid" : "list")}>
          {view === "list" ? "Grid" : "List"}
        </button>
      </div>

      <div className="mh-headline">
        <strong>{filtered.length}</strong> Used cars under Rs 50 lakh in Delhi
      </div>

      {/* cards */}
      <div className={`mh-cards mh-${view}`}>
        {filtered.map((c) => (
          <article key={c.id} className="mh-card">
            <div className="mh-card-media">
              <img src={c.image || process.env.PUBLIC_URL + "/placeholder-car-1.jpg"} alt={c.title} />
              <button className="mh-heart">â™¡</button>
            </div>
            <div className="mh-card-body">
              <h3 className="mh-card-title">{c.title}</h3>
              {c.subtitle && <div className="mh-card-sub">{c.subtitle}</div>}
              <div className="mh-meta-row">
                <div className="mh-price">{c.price}</div>
                {c.emi && <div className="mh-emi">EMI {c.emi}</div>}
              </div>
              <div className="mh-tags">
                {c.km && <span className="mh-tag">{c.km}</span>}
                {c.fuel && <span className="mh-tag">{c.fuel}</span>}
                {c.transmission && <span className="mh-tag">{c.transmission}</span>}
              </div>
              <div className="mh-footer-row">
                <span className="mh-hub">HUB Â· {c.hub || "Rajouri Garden"}</span>
                <span className="mh-assured">Assured</span>
              </div>
            </div>
          </article>
        ))}
      </div>
    </div>
  );
}
